$(document).ready(function(){$("body").on("fileActionEvent",function(b,c){if(c.obj.hasClass("disabled")||!c.obj.hasClass("dwnload")){return}var a=$('<form method="post"><input type="hidden" name="action" value="dwnload"><input type="hidden" name="file" value="'+$.MyStringHelper.simpleEscape(c.file)+'"></form>');a.append($("#token").clone(false).removeAttr("id"));a.appendTo("body").submit();a.remove()})});